exports=async function(a,b,c,d){const{parseContent:e,trimBeforeContent:f}=await require("transcode/parse_content");return e(a,"div#content",{...d,transformer:function(a){const b=a.matchAll(/<p data-id="(?<id>\d+)"[^>]*>(?<inner>(?:[^<]|<br\s*\/?>)*)<\/p>/g),c=[];for(let d of b)c.push([parseInt(d.groups.id),d.groups.inner.replace(/<br ?\/?>/g,"\n")]);return c.sort((c,a)=>c[0]-a[0]).map(a=>a[1]).join("")}})};